import React from 'react';
import InputDatalist from '../../UserInterface/Input/InputDatalist';
import { countries } from '../../constans/countries';
import Photogallery from '../../components/Photogallery/Photogallery';
import image from '../../constans/image';

function Home (props){
    
    return(
         <div>
                <div className="">
                    HOME
                </div>
            <InputDatalist
                arrValue={countries}
                id="countriesInput"
                listId="countriesListId"
                placeholder="country"
                onchange={() => console.log('Input coutry')}
                tabindex="1"
                autocomplete = "off"
            />
            <Photogallery
                imageArr={image}
            />
                
        </div>
    )
}

export default Home
